import * as React from 'react';
import Button from '@mui/material/Button';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import onClickHyvinvointi from "../App"

export default function PositionedMenu() {
  const [anchorEl, setAnchorEl] = React.useState(null);
  const open = Boolean(anchorEl);
  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };
  const handleClose = () => {
    setAnchorEl(null);

  };
  const handleClose1 = () => {
    setAnchorEl(null);
    onClickHyvinvointi()
  };

  return (
    <div>
      <Button
        id="demo-positioned-button"
        aria-controls={open ? 'demo-positioned-menu' : undefined}
        aria-haspopup="true"
        aria-expanded={open ? 'true' : undefined}
        onClick={handleClick}
      >
        something
      </Button>
      <Menu
        id="demo-positioned-menu"
        aria-labelledby="demo-positioned-button"
        anchorEl={anchorEl}
        open={open}
        onClose={handleClose}
        anchorOrigin={{
          vertical: 'top',
          horizontal: 'left',
        }}
        transformOrigin={{
          vertical: 'top',
          horizontal: 'left',
        }}
      >
        <MenuItem onClick={handleClose1}>Etusivu</MenuItem>
        <MenuItem onClick={handleClose}>Nettiajanvaraus</MenuItem>
        <MenuItem onClick={handleClose}>Hyvinvointipalvelut</MenuItem>
        <MenuItem onClick={handleClose}>kodinhoitopalvelut</MenuItem>
        <MenuItem onClick={handleClose}>EAH-koulutus</MenuItem>
        <MenuItem onClick={handleClose}>Hinnasto</MenuItem>
        <MenuItem onClick={handleClose}>Yhteystiedot</MenuItem>
        <MenuItem onClick={handleClose}>Ota yhtett√§</MenuItem>
        <MenuItem onClick={handleClose}>Galleria</MenuItem>
        <MenuItem onClick={handleClose}>Tapahtumat</MenuItem>
      </Menu>
    </div>
  );
}
